const CounterButtons = ({setCount, count}) => {

    return (
        <div className="row">

            <div className="col-3">
                <button
                    type="button"
                    className="btn btn-primary"
                    onClick={() => setCount(count + 1)}
                >
                    Increment
                </button>
                <button
                    type="button"
                    className="btn btn-primary"
                    onClick={() => setCount(count - 1)}
                >
                    Decerement
                </button>
            </div>
        </div>
    );
}
export default CounterButtons;
